shaders.vertex:
attribute vec4 aVertex;
attribute vec2 aTexCoord;
varying vec2 vTexCoord;

void main(void)
{
    vTexCoord = aTexCoord;
    gl_Position = aVertex;
}

shaders.fragment:
#pragma size(640, 480)
varying vec2 vTexCoord;
uniform sampler2D uChannel0;
uniform float uT;
uniform vec2 uResolution;
uniform vec2 uMouse;

uniform float u1; // 0.0, 1.0, 0.11
uniform float u2; // 0.0, 1.0, 0.34
uniform float u3; // 0.0, 1.0, 0.84

uniform vec4 uColor0; // #08100a
uniform vec4 uColor3; // #d80000
uniform vec4 uColor2; // #8fe700
uniform vec4 uColor1; // #86ceee

uniform float uSize; // 2.0, 100.0, 4.0
uniform float uThreshold; // 0.0, 1.0, 0.95
uniform float uAngle; // -180.0, 180.0, 60

const float PI = 3.141592653589793238462;
const float PI180 = PI / 180.0;
const vec2 rotationCenter = vec2(0.5, 0.5);

float ratio = uResolution.x / uResolution.y;


float sind(float a)
{
  return sin(a * PI180);
}

float cosd(float a)
{
  return cos(a * PI180);
}

float added(vec2 sh, float sa, float ca, vec2 c, float d)
{
  return 0.5 + 0.25 *
    (cos((sh.x * sa + sh.y * ca + c.x) * d) +
     cos((sh.x * ca - sh.y * sa + c.y) * d));
}

uniform vec4 uGrey; // 76, 150, 29

vec4 blur(in sampler2D tex, in vec2 coord)
{
  return texture2D(tex, coord);
}

vec4 halftone(vec4 color)
{
  vec2 shift = vec2(vTexCoord.x, vTexCoord.y / ratio) - rotationCenter;
  float raster = added(shift, sind(uAngle), cosd(uAngle), rotationCenter, 680.0 * PI / uSize);
  float avg = dot(vec4(uGrey.rgb, 0.0), color);
  float g = (raster * uThreshold + avg - uThreshold) / (1.0 - uThreshold);
  return vec4(g, g, g, 1.0);
}

void main(void)
{
    vec2 mouse = uMouse / uResolution;
    if (mouse.y < vTexCoord.y) {
      vec4 color = uColor0;
      vec4 c0 = blur(uChannel0, vTexCoord);
      vec4 raster = halftone(c0);
      float grey = dot(c0, vec4(uGrey.rgb, 0.0));
      if (grey > u3)
        color = uColor1;
      else if (grey > u2)
        color = uColor2;
      else if (grey > u1)
        color = uColor3;
      gl_FragColor = clamp(raster, color, vec4(1.0));
    }
    else {
      gl_FragColor = texture2D(uChannel0, vTexCoord);
    }
}
